//create a new component called Recipe
//this component will be used to display a single recipe
//we will use the recipe that was passed in from Recipes.js

import React from 'react'

export default function Recipe({location}) {
    const {recipe} = location.state
    return (
        <div>
            <h1>{recipe.recipeName}</h1>
            <h2>{recipe.recipeDescription}</h2>
            <h3>{recipe.recipeIngredients}</h3>
            <h4>{recipe.recipeInstructions}</h4>
        </div>
    )
}
